import Profile from '../Profile/Profile.js';
import lImg from '../Images/lion.jpg';
import zImg from '../Images/zebra.jpg'
import "./app.css";
function App () {

  return (
    <div className="App">
      <Profile
        fullName="Lion"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={lImg}
      />
      <Profile
        fullName="Zebra"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={zImg}
      />
      <Profile
        fullName="Cat"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={zImg}
      />
      <Profile
        fullName="Elephant"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={zImg}
      />
    </div>
    );
}

export default App;
